import { Ref } from "react";

interface IHomeLayoutProps {
  layoutRef: Ref<HTMLInputElement>;
}

const HomeLayout = (props: IHomeLayoutProps) => {
  const { layoutRef } = props;
  return (
    <div>
      <div ref={layoutRef} />
      <div></div>
    </div>
  );
};

export default HomeLayout;
